    const [actualizado, setActualizado] = useState([])

    const eliminar = (gastos) => {

        setActualizado(gastos);
    }
    console.log(actualizado)

    return (
        <div className="gastos-realizados">
            <h2>Listado</h2>
            {gastos.map(gasto => (
                <Gasto
                    key={gasto.id}
                    gasto={gasto}
                />
            ))}
        </div>
    )
}


Listado.propTypes = {
    gastos: PropTypes.array.isRequired
}
